$(function(){
	$('dl.collapse-list').each(function(){
		var dt = $(this).find('dt'),
			dd = $(this).find('dd');
		dd.hide();
		dt.click(function(){
			if($(this).hasClass('open')){
				dd.slideUp();
				dt.removeClass('open');
			} else{
				dd.slideUp();
				dt.removeClass('open');
				$(this).addClass('open').next('dd').slideDown();
			}
		});					
	})
});
$(function(){
	$('.multi-feature-list-feature').each(function(){
		var nav = $(this).find('.mfn-item'),
			media = $(this).find('.mfm-item');
		media.hide().first().show();
		nav.first().addClass('active');
		nav.click(function(){
			if(!$(this).hasClass('active')){
				nav.removeClass('active');
				$(this).addClass('active');
				media.hide().find('.feature-showcase').removeClass('active');
				media.eq($(this).index()).fadeIn().find('.feature-showcase').addClass('active');
			}
		});
	});
});
$(function(){
	$('.feature-grid.slider-enabled').each(function(){
		var $prev = $('<button>',{class:'slider-prev'}),
			$next = $('<button>',{class:'slider-next'}),
			$slider = $(this).flickity({
				wrapAround: true,
				autoPlay: false,
				adaptiveHeight: false,
				imagesLoaded: true,
				contain: true,
				freeScroll: false,
				responsive: true,
				pageDots:false,
				cellAlign: 'left',
				prevNextButtons: false
			});
		$prev.add($next).appendTo($(this));
		$prev.click(function(){
			$slider.flickity('previous');
		});
		$next.click(function(){
			$slider.flickity('next');
		});
	});
});
$(window).bind('load',function(){
	$('.feature-list-tabbed').each(function(){
		var scope = $(this),
			items = $(this).find('.feature-list-feature'),
			nav = false;
		if(items.length > 1){
			nav = $('<nav>',{class:'flt-nav'});
			scope.prepend(nav);
			items.hide().first().show();
		}
		items.each(function(i){
			var name = $(this).attr('data-tab-name'),
				tab = $('<button>',{class:'flt-tab'});
			tab.text(name).appendTo(nav);
			if(i == 0){
				tab.addClass('selected');
			}
			tab.click(function(){
				$(this).addClass('selected').siblings().removeClass('selected');
				items.hide().find('.feature-showcase').removeClass('active');
				items.eq(i).fadeIn().find('.feature-showcase').addClass('active');;
			});
		});
		if(nav){
			var navSlider = nav.flickity({
				wrapAround: false,
				autoPlay: false,
				adaptiveHeight: false,
				imagesLoaded: true,
				contain: true,
				freeScroll: true,
				responsive: true,
				pageDots:false,
				cellAlign: 'center',
				prevNextButtons: false
			});
		}
	});	
});